INSERT INTO `content` VALUES (, '1', 'www.java.com', 'Tutorial', 'Java technology', 'Java is a programming language and computing platform first released by Sun Microsystems in 1995. There are lots of applications and websites that will not work unless you have Java installed, and more are created every day. Java is fast, secure, and reliable. From laptops to datacenters, game consoles to scientific supercomputers, cell phones to the Internet, Java is everywhere! ', '10-07-2014', '0');
INSERT INTO `content` VALUES (, '2', 'www.struts.com', 'Tutorial', 'Struts Framework', 'Apache Struts 2 is an elegant, extensible framework for creating enterprise-ready Java web applications. The framework is designed to streamline the full development cycle, from building, to deploying, to maintaining applications over time. Apache Struts 2 was originally known as WebWork.', '10-07-2014', '0');
INSERT INTO `content` VALUES (, '3', 'www.hibernate.com', 'Tutorial', 'What is Hibernate?', 'Hibernate framework simplifies the development of java application to interact with the database. Hibernate is an open source, lightweight, ORM (Object Relational Mapping) tool.', '10-07-2014', '0');
INSERT INTO `content` VALUES (, '4', 'www.servlet.com', 'Tutorial', 'What is a Servlet?', 'Servlet is an API that provides many interfaces and classes including documentations.Servlet is an interface that must be implemented for creating any servlet.Servlet is a class that extend the capabilities of the servers and respond to the incoming request. It can respond to any type of requests.', '10-07-2014', '0');
INSERT INTO `content` VALUES (, '5', 'www.sql.com', 'Tutorial', 'Sql Database', 'MySQL is the most popular Open Source Relational SQL database management system. MySQL is one of the best RDBMS being used for developing web-based software applications.', '10-07-2014', '0');
